import react from "react";
import './style.css';
import Movies from './Movies';

function Top () { 
        return (
            <div>
                <div className="top-nav">
                    <a href="#">Action</a>
                    <a href="#">Comedy</a>
                    <a href="#">Drama</a>
                    <a href="#">Fantasy</a>
                    <a href="#">Home</a>
                    <a href="#">Horror</a>
                    <a href="#">Mystery</a>
                    <a href="#">Romance</a>
                    <a href="#">Thriller</a>
                </div>
                <Movies/>
            </div>
        )
    }
export default Top
